      Value: "<span>A product of the discovery of the first insect growth regulator, (S)-methoprene, Central Life Sciences is committed to producing environmentally compatible insect control. Central Life Sciences manufactures and markets some of the most recognized professional and consumer brands in the animal health, specialty pest control and public health/vector control markets. Central Life Sciences aims to enhance the quality of life of its consumers by improving the health and protection of companion animals, economic animals, plants, stored grains, and the environment.</span>"
